DROP TABLE IF EXISTS `pay`;
CREATE TABLE `pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `out_trade_no` varchar(100) NOT NULL DEFAULT '',
  `payment` varchar(64) DEFAULT NULL COMMENT '支付方式',
  `money` decimal(50,2) NOT NULL DEFAULT '0.00' COMMENT '支付总金额',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '支付状态(1=支付成功 2=支付失败 3=待支付)',
  `type` int(10) NOT NULL DEFAULT '0' COMMENT '付款类型1-支付宝',
  `uid` int(10) NOT NULL DEFAULT '0',
  `total` decimal(50,2) NOT NULL DEFAULT '0.00',
  `yunfee` decimal(50,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `ratio` decimal(50,2) DEFAULT '0.00' COMMENT '积分抵消金额',
  `ratioscore` int(10) DEFAULT '0' COMMENT '消耗积分',
  `coupon` decimal(50,2) DEFAULT '0.00',
  `couponcode` varchar(255) DEFAULT '',
  `callback` varchar(255) DEFAULT '' COMMENT '支付回调结果',
  `addressid` varchar(255) DEFAULT '0' COMMENT '地址',
  `url` varchar(255) NOT NULL DEFAULT '0',
  `param` text,
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0',
  `notify_param` text COMMENT '回调参数',
  `orgin_type` tinyint(8) DEFAULT NULL COMMENT '来源(1=购买订单2=充值订单3=捐赠订单...)',
  `type_name` varchar(150) DEFAULT NULL COMMENT '订单类型名称',
  `orgin_code` varchar(255) DEFAULT NULL COMMENT '外单code',
  `order_auth_id` int(11) DEFAULT '0' COMMENT '订单授权id',
  `order_auth_type` tinyint(1) DEFAULT '0' COMMENT '订单授权类型（1=优惠授权2=代付授权）',
  `is_need_audit` tinyint(1) DEFAULT '0' COMMENT '是否需要审核才能支付完成',
  `audit_status` tinyint(2) DEFAULT '0' COMMENT '支付状态(1=审核通过 2=审核不通过 3=待审核)',
  `audit_handler` varchar(255) DEFAULT NULL COMMENT '审核人',
  `audit_remark` varchar(255) DEFAULT NULL COMMENT '审核备注',
  `payee` varchar(255) DEFAULT NULL COMMENT '收款人',
  `take_time` int(11) DEFAULT NULL COMMENT '收款时间',
  `take_remark` varchar(255) DEFAULT NULL COMMENT '收款备注',
  `payee_remark` varchar(255) DEFAULT NULL COMMENT '付款备注',
  `payment_type` tinyint(10) DEFAULT NULL COMMENT '支付类型',
  `payee_serial_num` varchar(255) DEFAULT NULL COMMENT '收款流水号',
  `created_time` int(11) DEFAULT NULL COMMENT '创建时间',
  `updated_time` int(11) DEFAULT NULL COMMENT '修改时间',
  `created_by` int(11) DEFAULT NULL COMMENT '创建人',
  `updated_by` int(11) DEFAULT NULL COMMENT '修改人',
  `audit_time` int(11) DEFAULT '0' COMMENT '审核时间',
  `is_lock` tinyint(1) DEFAULT '0' COMMENT '是否锁定提交支付',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`,`status`) USING BTREE,
  KEY `out_trade_no` (`out_trade_no`,`status`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=10456 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='在线支付表';

